import React from "react";
import FeaturedCard from "./FeaturedCard";
import '../SearchFunctions/SearchMovies.css';


function FeaturedMovies (props) {

    let data = [];
    if (props.data) {
        data = props.data.movie || [];
    }

    return (
        <div className="result" className="grid" >
            {props.movies.map((movie, index) => (
                <Card className="item" key={movie.imdbID} movie={movie} />
            ))}
        </div>
    );
}

export default FeaturedMovies;
